import React from "react";

const Branches = () =>{
  return(
      <>
      <div className="border-2">
        <b>KARUR</b>
        <p><span>Location:</span>karur</p>
        <p><span>phone:</span>1234567890</p>
        <p><span>started:</span>2019</p>
        <hr />
      </div>
</>
  )
}

export default Branches;
